import React, { Component } from 'react'


class Register extends Component {
  regStyle = {
    position: 'relative',
    top: '42px',
    right: '65px'
  }

  render () {
    return(
      <div className ="login-container">
      <button style = {this.regStyle}>Register</button>
      </div>
    )
  }
}

export default Register
